import React from 'react';

const About = () => {
  return (
    <div className="p-4 text-gray-800 dark:text-gray-200">
      <h1 className="text-2xl font-bold">About Us</h1>
      <p>Hey, This is the about page content.</p>
    </div>
  );
};

export default About;
